export const GIF_LIBRARY_BY_ALIAS = Object.fromEntries(
  GIF_LIBRARY.map((item) => [item.alias, item])
) as Record<string, GifLibraryEntry>;

export const GIF_LIBRARY_BY_CATEGORY = GIF_LIBRARY.reduce((acc, item) => {
  const existing = acc[item.category] ?? [];
  existing.push(item);
  acc[item.category] = existing;
  return acc;
}, {} as Record<GifLibraryCategory, GifLibraryEntry[]>);

